import React from "react";
import VideoItem from "../Videos/VideoItem";

const ReelVideos = (props) => {
  const removeVideoHandler = () => {};
  return (
    <div>
      {props.items.map((video) => {
        return (
          <div>
            <VideoItem key={video.id} source={video} />
            <button type="button" onClick={removeVideoHandler}>
              Remove from Reel
            </button>
          </div>
        );
      })}
    </div>
  );
};

export default ReelVideos;
